(window.webpackJsonp=window.webpackJsonp||[]).push([[30],{"3cs0":function(e,a,t){"use strict";t.r(a);var o=t("q1tI"),r=t.n(o),i=t("S6uJ");a.default=function(){return r.a.createElement(i.a,{lang:"es",title:"FAQ | Full stack open 2020",seoDescription:"Frequently asked questions"})}},S6uJ:function(e,a,t){"use strict";var o=t("KQm4"),r=t("q1tI"),i=t.n(r),s=t("9Koi"),n=t("XSxc"),l=t("jsr+"),c=t("CN8t"),u=t("Bl7J"),d=t("vrFN"),p=t("K4iA"),m=t("qoe/"),b=t("5I0T"),f=t.n(b);a.a=function(e){var a=e.lang,t=e.title,r=e.seoDescription,b=Object(s.a)().t,h=m[a]||[];return i.a.createElement(u.a,null,i.a.createElement(d.a,{lang:a,title:t,description:r,keywords:[].concat(Object(o.a)(f.a),["faq","frequently asked questions","ukk","usein kysytyt kysymykset"])}),i.a.createElement(l.a,{className:"container link spacing spacing--after"},i.a.createElement(p.a,{className:"spacing--after-small",headingLevel:"h1",text:b("faqPage:faqTitle")}),h.map((function(e){return i.a.createElement(n.a,{track:!0,key:e.title,title:e.title,content:e.text})}))),i.a.createElement(c.a,{lang:a}))}},"qoe/":function(e){e.exports=JSON.parse('{"fi":[{"title":"Pitääkö jokainen osa palauttaa omaan repositorioon?","text":["Ei. Voit käyttää yhtä tai useampaa repositoriota, tärkeintä on, että asiat repositorion sisällä ovat selkeästi nimettyjä."]},{"title":"Voinko muokata tekemääni palautusta?","text":["Et. Kaikki osan tehtävät on palautettava kerralla. Jos merkkasit tehtäviä vahingossa väärin tai typotit repositorion nimen, lähetä mailia osoitteeseen matti.luukkainen@helsinki.fi"]},{"title":"Minulla ei ole opinto-oikeutta Helsingin Yliopistoon. Voinko suorittaa kurssin?","text":["Voit! Tosin suoritusmerkinnän voit saada vasta 15.3.2021 alkavassa MOOC:issa, et myöskään voi palauttaa tehtäviä vielä. MOOCin ja kampuskurssin sisältö on sama, joten nyt tehty työ ei mene hukkaan."]}],"en":[{"title":"How do I submit the exercises?","text":["The exercises are submitted to GitHub, and by marking the exercises as done in the exercise submission system. You can read more from <a href=\'/en/part0/general_info#submitting-exercises\'>here</a>. "]},{"title":"Do I have to submit each part to a separate repository?","text":["No. You can use one or more repositories, most important is to name everything in a repository clearly. "]},{"title":"Can I edit a submission?","text":["No. All exercises for a part must be submitted at the same time. If you marked exercises wrong by accident, or wrote the repository name wrong, send an e-mail to matti.luukkainen@helsinki.fi."]},{"title":"I do not have studyright in University of Helsinki. Can I sign up for this course?","text":["No, but there shall be a open version of the course starting at 15th March <a href=\'https://fullstackopen.com/\'>here!</a>"]}],"es":[{"title":"¿Habrá un nuevo curso en 2021?","text":["Sí, la nueva versión del curso comenzará el 15.3.2021. <br><br> No habrá cambios importantes en el contenido del curso. <br><br> La versión 2020 se puede ampliar en la versión 2021, ver más <a href=\'/en/part0/general_info#expanding-on-a-previously-completed-course\'>aquí</a>"]},{"title":"¿Cómo me registro en el curso?","text":["No tienes que registrarte hasta que quieras hacer el examen del curso. El examen se realiza en el sistema Moodle de la Open University. Puedes encontrar más información <a href=\'/en/part0/general_info#grading \'>aquí</a>. Tenga en cuenta que solo las personas con número de seguro social finlandés pueden participar en los exámenes y obtener créditos ECTS oficiales. Para el certificado del curso, no es necesario registrarse ni número de seguro social finlandés."]},{"title":"¿Cuántos créditos tiene el curso?","text":["El curso es de 3-9 créditos ECTS <a href=\'/en/part0/general_info#grading\'> dependiendo de la cantidad de ejercicios devueltos </a>. Después de completar el curso, puede continuar profundizando sus conocimientos sobre el tema importa haciendo <a href=\'/en/part0/general_info#full-stack-project\'>proyecto Full Stack</a> por créditos ETCS 1-10. Tenga en cuenta que solo las personas con número de seguridad social finlandés pueden obtener créditos ECTS oficiales. Para el certificado del curso, no se necesita registro ni número de seguro social finlandés."]},{"title":"¿Cuándo es la fecha límite para los ejercicios y el examen?","text":["Puedes completar el curso a tu propio ritmo. El curso solo tiene una fecha límite para los ejercicios y los exámenes el 10 de enero de 2021 a las 23.59.59. Ten en cuenta que debes registrarte para el examen a más tardar el día anterior la fecha límite 9.1.2021."]},{"title":"¿Cómo envío los ejercicios?","text":["Los ejercicios se envían a GitHub y se marcan los ejercicios como realizados en el sistema de envío de ejercicios. Puede leer más en <a href=\'/en/part0/general_info#submitting-exercises\'>aquí</a>."]},{"title":"¿Tengo que enviar cada parte a un repositorio separado?","text":["No. Puede usar uno o más repositorios, lo más importante es nombrar todo en un repositorio claramente"]},{"title":"¿Puedo editar un envío?","text":["No. Todos los ejercicios de una parte deben enviarse al mismo tiempo. Si marcó los ejercicios incorrectamente por accidente o escribió el nombre del repositorio incorrectamente, envíe un correo electrónico a matti.luukkainen@helsinki.fi."]},{"title":"¿Cuándo y cómo puedo obtener mis créditos?","text":["Puede obtener sus créditos después de enviar suficientes ejercicios para aprobar el curso, aprobar el examen del curso e informarnos a través del sistema de envío de ejercicios que está listo con el curso. La fecha límite es el 10 de enero de 2021. Leer más <a href=\'/en/part0/general_info/#grading\'>aquí</a>. Tenga en cuenta que solo las personas con número de seguro social finlandés pueden obtener créditos ECTS oficiales. Para el certificado del curso, no se necesita registro ni número de seguro social finlandés."]},{"title":"¿Recibo un certificado después de completar el curso?","text":["Sí, el certificado está disponible para todos los que aprueben el curso antes del 10 de enero de 2021. Puede descargar el certificado después de completar el curso desde el sistema de envío de ejercicios. Para el certificado del curso, no es necesario registrarse en la universidad abierta y el número de seguro social finlandés"]},{"title":"¿Necesito un número de seguro social finlandés para obtener el certificado del curso?","text":["Para el certificado del curso no se necesita el número de seguro social finlandés. Puede descargar el certificado después de completar el curso desde el sistema de envío de ejercicios."]},{"title":"¿Debo registrarme en Open University para obtener el certificado del curso?","text":["Para el certificado del curso, no es necesario registrarse en Open University. Puede descargar el certificado después de completar el curso desde el sistema de envío de ejercicios"]},{"title":" ¿Qué ha cambiado desde el año pasado? ","text ":["Solo hay cambios menores en las partes 0-4. La parte 5d, <i>prueba de extremo a extremo</i> usando la biblioteca Cypress.io- es material casi completamente nuevo. El uso de ganchos personalizados se ha movido de la parte 5 a la parte 7 con contenido nuevo. <br> <br> La parte 6, que trata sobre Redux, se concentra en la nueva api de redux basada en hook. El material sobre react-router en la parte 7 también se ha actualizado para usar el hook -api. Semantic UI React ha sido reemplazada con la biblioteca MaterialUI debido a la falta de mantenimiento. <br> <br> La parte 8 en GraphQL tiene actualizaciones importantes, especialmente en Apollo Client, que finalmente tiene apis basadas en hook estable. La parte 9 en TypeScript es completamente nuevo. <br><br> El material del curso del año pasado se puede encontrar en <a href=\'https://fullstackopen-2019.github.io/\'>https://fullstackopen-2019.github.io/</ a>. "]},{"title":" Comencé el curso el año pasado, ¿cómo debo continuar? ","text ":["Lea más de eso <a href=\'/en/part0/general_info#expanding-on-a-previously-completed-course\'>aquí</a>"]},{"title":"Escuché que podría obtener una entrevista de trabajo completando el curso","text ":["Así es. Si completa el curso con créditos completos y completa el trabajo práctico con 10 créditos, obtendrá una entrevista de trabajo con nuestros socios. Leer más <a href=\'/en/part0/general_info#interview-promise\'>aquí</a>. Tenga en cuenta que sólo las personas con número de seguridad social finlandesa pueden conseguir tomar parte a examen y obtener créditos ECTS oficiales."]}],"zh":[{"title":"2021 年会有新的课程吗?","text":["是的，新版本的课程会在2021年3月15号开始。<br><br>课程的主体内容不会有太大的改变。<br><br> 2021年版本的内容会在2020年的基础上做进一步的延伸，可以参考 <a href=\'/zh/part0/%E5%9F%BA%E7%A1%80%E7%9F%A5%E8%AF%86#expanding-on-a-previously-completed-course\'>这一章节</a>的内容\'>这里</a>. "]},{"title":"我如何报名这门课程呢？","text":["除非你想参加课程考试，否则你并不必报名。 考试是在开放大学的 Moodle 系统中完成的。 在<a href=\'/zh/part0/general_info#grading\'>这里</a>.你可以找到更多资料。<br><br>请注意，只有拥有芬兰社保账号的人才能参加考试并获得官方的 ECTS 学分。 <br><br>而对于课程证书，不需要报名或芬兰社保号码。"]},{"title":"这门课多少学分呢？","text":["该课程为3-12个ECTS学分，这<a href=\'/zh/part0/general_info#grading\'>取决于您提交的练习次数</a>。 完成课程后，您可以通过进行<a href=\'/zh/part0/general_info#full-stack-project\'> Full Stack项目</a>来加深对课程内容的了解，从而获得1-10 ETCS学分。 <br><br>请注意，只有具有芬兰社保号码的人才能获得ECTS官方积分。 <br><br>对于课程证书，不需要注册或芬兰社保号码。"]},{"title":"练习与考试的截止日期是什么时候呢？","text":["您可以按照自己的进度完成课程。 提交联系的截止日期但是2021年3月1日的23点59分59秒，如果你想要获得公开大学的学分，截止日期为2021年1月10日的23点59分59秒。 请记住，您必须在截止日期的前一天，即2020年1月9日报名参加考试。"]},{"title":"我如何提交练习作业呢？","text":["练习将提交到GitHub，并在练习提交系统中将练习标记为完成。 您可以从<a href=\'/zh/part0/general_info#submitting-exercises\'>这里</a>阅读更多相关内容。"]},{"title":"我需要为每次提交都创建一个代码仓库吗？","text":["不需要。您可以使用一个或多个代码仓库，最重要的是清楚地描述仓库中的所有内容。"]},{"title":"我能重新编辑我的提交吗？","text":["不可以。每部分的所有练习必须一起提交。如果你不小心将练习提交错了，或者把仓库名字写错了，给 matti.luukkainen@helsinki.fi 这个邮箱发送一个说明。"]},{"title":"我什么时候，以及如何获得自己的学分呢？","text":["当你提交足够的练习，达到课程通过标准后，通过了课程考试，并通过练习提交系统告知我们所有准备已经妥当，才能获得学分。 截止日期是2020年1月10日。在<a href=\'/zh/part0/general_info/#grading\'>此处</a>了解更多信息。 <br><br>请注意，只有具有芬兰社保号码的人才能获得ECTS官方积分。 <br><br>对于课程证书，不需要注册或芬兰社保号码。"]},{"title":"在我完成这门课程后能够获得结业证书吗？","text":["是的，所有在2021年1月10日之前通过课程的人都可获得证书。您可以从练习提交系统中完成课程后下载证书。 对于课程证书，不需要注册公开大学和芬兰的社保号码。"]},{"title":"为了获得课程的结业证书，我需要芬兰的社保号码吗？","text":["对于课程结业证书来说，不需要芬兰社保号码。 完成课程后，您可以从练习提交系统下载证书。"]},{"title":"为了获得课程的结业证书，我需要注册公开大学吗？","text":["对于课程结业证书来说，不需要注册公开大学。 完成课程后，您可以从练习提交系统下载证书。"]},{"title":"这门课与去年的内容有什么不同？","text":["对于0~4章节，只有一些很小的改动。第5d章节，<i>端到端测试</i> 利用了Cypress.io 这个库，这几乎是全新的内容。使用自定义钩子（custom hook）的内容已经从第5章节转移到了第7章节，并添加了一些新的内容。 <br><br> 第6章是讲Redux的，主要介绍了新的基于hook的redux API。第7章的react-router 也更新为使用hook-api。由于Semantic UI React 缺乏维护，其内容已经被替换为了 MaterialUI library 的内容。<br><br> 第8章 GraphQL有了较大版本的升级，尤其引入了Apollo Client，它终于有了稳定的基于hook的api。第9章是全新的内容。<br><br> 去年的课程内容可以通过<a href=\'https://fullstackopen-2019.github.io/\'>https://fullstackopen-2019.github.io/</a>进行访问。"]},{"title":"我是从去年的课程开始学习的，我应该怎么续接今年的课程呢？","text":["阅读更多 <a href=\'/zh/part0/%E5%9F%BA%E7%A1%80%E7%9F%A5%E8%AF%86#expanding-on-a-previously-completed-course\'>这一章节</a>的内容。"]}]}')}}]);
